import Vue from "vue";
import App from "./App.vue";
import vuetify from "./plugins/vuetify";
import VueRouter from "vue-router";

Vue.config.productionTip = false;

Vue.use(VueRouter);

const ForSmallBusiness = { template: "<div>For Small Business</div>" }; // Placeholder
const ForEnterprise = { template: "<div>For Enterprise</div>" }; // Placeholder

const routes = [
  { path: "/for-small-business", component: ForSmallBusiness },
  { path: "/for-enterprise", component: ForEnterprise },
];

const router = new VueRouter({
  mode: "history", 
  routes,
});

new Vue({
  vuetify,
  router,
  render: (h) => h(App),
}).$mount("#app");
